import React from "react";

import { Dock, DockIcon } from "../ContactsDock/ContactsDock.tsx";

export type IconProps = React.HTMLAttributes<SVGElement>;

export function ProjectDock(props) {
  return (
    <div className="relative flex  w-full max-w-[32rem] flex-col items-center justify-center overflow-hidden rounded-lg">
      <Dock>
        <DockIcon
          className="dock_item"
          onClick={() => {
            if(props.github){
            window.open(props.github, "_blank");
            }
          }}
        >
          <Icons.gitHub className="h-10 w-10" />
        </DockIcon>
        
        <DockIcon className="dock_item"
        onClick={()=>{
            if (props.linkedin){
          window.open(props.linkedin, "_blank");
            }
        }}>
          <Icons.linkedin className="h-10 w-10" />
        </DockIcon>
        
        <DockIcon className="dock_item" 
        onClick = {()=>{
            if (props.certificate){
          window.open(props.certificate, "_blank");
            }
        }}>
          <Icons.certificate className="h-10 w-10" />
        </DockIcon>
        
      </Dock>
    </div>
  );
}

